import Layout from './layout'

function Home() {
    
    return(
        <Layout>
            <div>
                <div className="home_top">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-12">
                                <h1>fun and adventure with joyful trip</h1>
                                <h2>Never let your memory be greater than your dream</h2>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-md-4 ofsset-md-4">
                                
                            </div>
                        </div>
                    </div>
                </div>
                <style jsx>
                    {`
                    
                    .home_top{
                        background-image:linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url("../static/images/adv2.jpg");
                        background-attachment: fixed;
                        background-position: center;
                        background-size: cover;
                        color: #fff;
                        text-align:center;
                        padding-top: 200px;
                        padding-bottom: 200px;
                    }
                    .home_top h1{
                        font-size:60px;
                        text-transform: capitalize;
                    }
                    
                    `}
                </style>
            </div>
        </Layout>
    ) 
  }
  
  export default Home
